function popupMessage(message, klass) {
    notificationTop = "+" + ($(document).scrollTop() + 60);
    $('#notification').removeClass().addClass('alert ' + klass);
    $('#flash-msg-text').html(message);
    $('#notification').show().animate({
        top: notificationTop
    }, 200);
    $('#notice-close').click(function () {
        $('#notification').hide();
    });
    setTimeout(function () {
        $('#notification').hide().animate({
            top: "-60"
        }, 500);
    }, 20000);
}

//ajax load in browser back button

$(function () {
    $(window).bind("popstate", function () {
        $.getScript(location.href);
    });
});


$(document).ajaxStart(function () {
    startLoader();
});

$(document).ajaxComplete(function () {
    stopLoader();
});

function startLoader() {
    $('body').append("<div class='loading'> <img src='data:image/gif;base64,'/> </div>");
}

function stopLoader() {
    $(".loading").remove();
}

