function setScriptProperty(target, model, redirect) {

    var targetElement = $("#" + target);
    targetElement.on("ajax:success", function (e, data, status, xhr) {
        if (redirect != '') {
            window.location.href = redirect;
        }
        else {
            popupMessage('Success', '');
        }
    }).on("ajax:error", function (e, data, status, xhr) {
        targetElement.render_form_errors(model, data.responseJSON);
    });
}

$.fn.render_form_errors = function (model_name, errors) {
    this.clear_form_errors();
    var currentForm = this;
    $.each(errors, function (field, messages) {
        var name = model_name + "[" + field + "]";
        var input = currentForm.find("input[name='" + name + "']");
        input.parents('.form-group').addClass('has-error');
        return input.parent().append('<span class="help-block">' + $.map(messages, function (m) {
                return m.charAt(0).toUpperCase() + m.slice(1);
            }).join('<br />') + '</span>');
    });
};

$.fn.clear_form_errors = function () {
    this.find('.form-group').removeClass('has-error');
    this.find('span.help-block').remove();
};

function parseViewHtml(targetElement, context) {
    var source = $(targetElement).html();
    var template = Handlebars.compile(source);
    return template(context);
}

